// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

contract SetBalances {

    address public admin;
    
    constructor() {
        admin = msg.sender; // The address deploying the contract
    }

    // Function to transfer 100 ETH to the admin address
    function setAdminBalance(address adminAddress) public {
        require(msg.sender == admin, "Only the admin can set the balance");
        
        // Transfer 100 ETH to admin address
        payable(adminAddress).transfer(100 ether);
    }

    // Function to set all other accounts to 0 ETH (burning their balance)
    function setAllToZero(address[] memory addresses) public {
        require(msg.sender == admin, "Only the admin can set the balance");
        
        for (uint i = 0; i < addresses.length; i++) {
            // Burn balance of each address (set to 0 ETH)
            payable(addresses[i]).transfer(0 ether);
        }
    }
    
    // Fallback function to receive Ether
    receive() external payable {}
}
